import React from 'react';
import { useHistory } from 'react-router-dom';
import './styles.css'; // Assuming styles.css is in the same directory

function VolunteerPointsDashboard() {
  const history = useHistory();

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <img src="nyclogo.jpg" alt="Nedlands Yacht Club Logo" className="logo" />
        <h1>Volunteer Management</h1>
      </nav>

      {/* Main Section */}
      <header className="main-section">
        <div className="overlay">
          <div className="text-container">
            <h2>Volunteer Management</h2>
            <p>Empowering the community, one volunteer at a time.</p>
          </div>
        </div>
      </header>

      {/* Cards Section */}
      <section className="cards-section">
        <div className="card" onClick={() => history.push('/add-points')}>
          <h3>Add Volunteer Points</h3>
        </div>
        <div className="card" onClick={() => history.push('/reward-checkin')}>
          <h3>Reward Check-In</h3>
        </div>
        <div className="card" onClick={() => history.push('/check-history')}>
          <h3>Check Volunteer History</h3>
        </div>
      </section>
    </div>
  );
}

export default VolunteerPointsDashboard;
